import React, { Component } from 'react';
import {

    Card,
    CardImg,
    CardText,
    CardBody,
    CardTitle,
    CardSubtitle,
    Button
} from 'reactstrap';

export class GameCard extends Component {
    constructor(props) {
        super(props);
    }

    render() {

        let {id, name, screenshot} = this.props.games;
        return (

            <div>
                <Card>
                    <CardImg top width="10%" src={screenshot} alt="Card image cap" />
                    <CardBody>

                        <CardTitle>{name}</CardTitle>
                        <CardText>{id}</CardText>

                        <Button
                            color="primary"
                            onClick={() => this.props.removeGame(id)}
                        >
                            Delete
                        </Button>

                    </CardBody>
                </Card>
            </div>

        );
    }
}

export default GameCard;
